def find_clumps(genome, k, L, t):
    # create empty set to track 
    clumps = set()
    # iterate over genome string and subset (L,t) string
    for i in range(len(genome) - L + 1):
        # create window based on length L 
        window = genome[i:i+L]
        # create dictionary to store frequency of each k-mer
        freqs = {}
        # iterate over sliding windo            
        for j in range(len(window) - k + 1):
            kmer = window[j:j+k]
            if kmer not in freqs:
                freqs[kmer] = 0
            freqs[kmer] += 1
        # separate kmers that meet or exceed frequency t
        for kmer, count in freqs.items():
            if count >= t:
                clumps.add(kmer)
    return list(clumps)

# extra dataset 
genome = ""
k = 9
L = 481
t = 20

result = find_clumps(genome, k, L, t)
print("\nGenome:  " + genome + "\n")
print("Found clumps: " + str(result) + "\n")
